import React from 'react';

import { withFirebase } from '../Firebase';
import { Button } from 'semantic-ui-react';

const SignOutButton = ({ firebase }) => (
    <Button onClick={firebase.signOut}>
        Sign Out
    </Button>
)

export default withFirebase(SignOutButton)
